// import React from 'react'
// // import Todos from '../Todos';

const initState = {
    post : [ 
        {id:'1', title: "this is for fun" , body: "React uses ES6, and you should be familiar with some of the new features like:"},
        {id:'1', title: "this is another one for fun" , body: "Props are arguments passed into React components."},
        {id:'1', title: "this is the last one fun" , body: "and this is the body  and the third one"}
    ]
}

const rootReducer = (state = initState, action) =>{
    return state; 
}


export default rootReducer;
